import React from 'react';
import StoryPage from './storypage';

const App = () => {
  const exampleStory =[
    { 
    id: '1',
    title: 'Example Story',
    content: 'This is the content of the example story.'
    },
    { 
      id: '2',
      title: 'Book',
      content: 'This is the content of the example story.'
      },
]
     
  return (
    <div>
      <StoryPage 
        storyId={exampleStory.id} 
        title={exampleStory.title} 
        content={exampleStory.content} 
      />
    </div>
  );
};

export default App;
